import React, { useState, useEffect } from "react";
import axios from "axios";

function App() {
  const [data, setData] = useState({ data: [] });

  useEffect(() => {
    const fetchData = async () => {
      const response = await axios(
        "https://api.coindesk.com/v1/bpi/historical/close.json?start=2019-09-01&end=2019-12-10"
      );
      setData(response);
    };
  }, []);
  console.log("object", data);
  return (
    <div>
      <h1>the new app works</h1>
      hello App
    </div>
  );
}

export default App;
